CREATE DATABASE IF NOT EXISTS DatabaseDesign;
USE DatabaseDesign;

-- Create Tables
CREATE TABLE State (StateId INT NOT NULL AUTO_INCREMENT PRIMARY KEY,StateName VARCHAR(255) NOT NULL);
CREATE TABLE VaccinationRecord (RecordId INT NOT NULL AUTO_INCREMENT PRIMARY KEY,TotalVaccinations INT NOT NULL,Date VARCHAR(255) NOT NULL,StateId INT NOT NULL,FOREIGN KEY (StateId) REFERENCES State(StateId) ON DELETE RESTRICT);
CREATE TABLE PeopleFullyVaccinated (Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY, FullyVaccinatedPerHundred INT, FullyVaccinated INT NOT NULL, Date VARCHAR(255) NOT NULL, StateId INT NOT NULL, FOREIGN KEY (StateId) REFERENCES State(StateId) ON DELETE RESTRICT);
CREATE TABLE PeoplePartiallyVaccinated (Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY, Date VARCHAR(255) NOT NULL, PartiallyVaccinated INT NOT NULL, StateId INT NOT NULL, FOREIGN KEY (StateId) REFERENCES State(StateId) ON DELETE RESTRICT);
CREATE TABLE People_BoosterShots (TotalBoosterShots INT NOT NULL, TotalBoosterPerHundred INT, Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY, Date VARCHAR(255) NOT NULL, StateId INT NOT NULL, FOREIGN KEY (StateId) REFERENCES State(StateId) ON DELETE RESTRICT);
CREATE TABLE VaccinationsDailyRecord (RecordId INT NOT NULL AUTO_INCREMENT PRIMARY KEY, Date VARCHAR(255) NOT NULL, DailyChangeInNoOfDoses INT NOT NULL, DailyVaccinationPerMillion INT NOT NULL, DailyVaccinations INT NOT NULL, StateId INT NOT NULL, FOREIGN KEY (StateId) REFERENCES State(StateId) ON DELETE RESTRICT);

